    false,nt"url": null,nt"notes": "This data set represents an updated Ecological
    Subsection Map for Northern Alaska. This update includes permafrost mapping to include
    the following new layers: permafrost extent, massive ice, thaw settlement potential,
    segregated ice and thermokarst landforms. A prior 2014 revision focused on correcting
    coding errors identified in the original 2012 version. The 2012 mapping effort focused
    on completing the the southern NPRA, improving mapping of glacial and outwash deposits
    within the Brooks Foothills, and improving consistency with existing surficial and
    bedrock geology maps in northern Alaska.",nt"license_title": null,nt"extras":
